# Identify indices of outliers\n    outliers = abs_z_scores > z_thresh\n    outlier_indices = df[column_name][outliers].index\n\n    # Replace outliers with NaN\n    df.loc[outlier_indices, column_name] = None\n\n    # Interpolate the missing (outlier) values\n    df[column_name] = df[column_name].interpolate()\n\n    return df\n\n# Apply the function to both 'Kandy' and 'Dambulla' columns\ndf = handle_outliers_with_interpolation(df.copy(), 'Kandy')\ndf = handle_outliers_with_interpolation(df, 'Dambulla')\n\n# Check if outliers are handled\ndf.head()\n","metadata":{"execution":{"iopub.status.busy":"2024-10-25T13:27:40.507288Z","iopub.execute_input":"2024-10-25T13:27:40.507938Z","iopub.status.idle":"2024-10-25T13:27:40.531568Z","shell.execute_reply.started":"2024-10-25T13:27:40.507905Z","shell.execute_reply":"2024-10-25T13:27:40.530439Z"},"trusted":true},"execution_count":15,"outputs":[{"execution_count":15,"output_type":"execute_result","data":{"text/plain":"        Date   Kandy  Dambulla  Exchange Rate    Month\n0 2020-01-01  296.43     305.0         181.50  2020-01\n1 2020-01-02  267.86     272.5         181.03  2020-01\n2 2020-01-03  239.29     240.0         181.37  2020-01\n3 2020-01-04  210.71     207.5         181.35  2020-01\n4 2020-01-05  182.14     175.0         181.34  2020-01","text/html":"<div>\n<style scoped>\n    .dataframe tbody tr th:only-of-type {\n        vertical-align: middle;\n    }\n\n    .dataframe tbody tr th {\n        vertical-align: top;\n    }\n\n    .dataframe thead th {\n        text-align: right;\n    }\n</style>\n<table border=\"1\" class=\"dataframe\">\n  <thead>\n    <tr style=\"text-align: right;\">\n      <th></th>\n      <th>Date</th>\n      <th>Kandy</th>\n      <th>Dambulla</th>\n      <th>Exchange Rate</th>\n      <th>Month</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <th>0</th>\n      <td>2020-01-01</td>\n      <td>296.43</td>\n      <td>305.0</td>\n      <td>181.50</td>\n      <td>2020-01</td>\n    </tr>\n    <tr>